import React from "react";
import BookingForm from ".BookingForm";

const Booking = (props) => {
  return (
    <BookingForm
      availableTimes={propos.availableTimes}
      dispatch={propos.dispatch}
      SubmitForm={propos.SubmitForm}
    />
  );
};

export default Booking;
